// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract BlockSniper {

    address public owner;
    uint256 public baseFee; 
    
    mapping(uint256 => uint256) public attemptCounters;
    mapping(uint256 => uint256) public prizePools;

    uint256 public bonusPoolHard;
    uint256 public bonusPoolNormal;
    uint256 public bonusPoolEasy;
    
    uint256 public percentHard;
    uint256 public percentNormal;
    uint256 public percentEasy;

    mapping(address => uint256) public totalWagered;
    mapping(address => uint256) public totalWon;

    address public biggestWinner;
    uint256 public biggestPrize;
    address public biggestBettor;
    uint256 public biggestTotalWagered;

    mapping(address => string) public usernames;

    event SnipeSuccess(address indexed winner, uint256 blockHit, uint256 prize);
    event SnipeMiss(address indexed player, uint256 startBlock, uint256 entryFee);
    event BonusPoolsFunded(uint256 totalAmount, uint256 hardShare, uint256 normalShare, uint256 easyShare);
    event PlayerStatsUpdated(address indexed player, uint256 totalWagered, uint256 totalWon);
    event UsernameSet(address indexed player, string newUsername);

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }

    constructor() {
        owner = msg.sender;
        percentHard = 45;
        percentNormal = 25;
        percentEasy = 15;
        baseFee = 0.1 ether;
    }

    function getCurrentEntryFee(uint256 _startBlock) public view returns (uint256) {
        return baseFee * (attemptCounters[_startBlock] + 1);
    }

    function getBonusPools() public view returns (uint256 hard, uint256 normal, uint256 easy) {
        return (bonusPoolHard, bonusPoolNormal, bonusPoolEasy);
    }

    function getPlayerStats(address player) public view returns (uint256 wagered, uint256 won) {
        return (totalWagered[player], totalWon[player]);
    }

    function setUsername(string memory _newUsername) public {
        require(bytes(_newUsername).length > 0, "Username cannot be empty");
        require(bytes(_newUsername).length <= 32, "Username is too long (max 32 chars)");
        usernames[msg.sender] = _newUsername;
        emit UsernameSet(msg.sender, _newUsername);
    }

    function setDistributionPercentages(uint256 _hard, uint256 _normal, uint256 _easy) public onlyOwner {
        require(_hard + _normal + _easy <= 100, "Percentages cannot exceed 100");
        percentHard = _hard;
        percentNormal = _normal;
        percentEasy = _easy;
    }
    
    function setBaseFee(uint256 _newBaseFee) public onlyOwner {
        baseFee = _newBaseFee;
    }

    function collectAndDistributeStalePool(uint256 _fromBlock) public onlyOwner {
        require(block.number > _fromBlock, "The source block has not passed yet");
        uint256 amount = prizePools[_fromBlock];
        require(amount > 0, "No prize pool to collect");

        prizePools[_fromBlock] = 0;

        uint256 hardShare = (amount * percentHard) / 100;
        uint256 normalShare = (amount * percentNormal) / 100;
        uint256 easyShare = (amount * percentEasy) / 100;
        uint256 ownerShare = amount - hardShare - normalShare - easyShare;
        
        bonusPoolHard += hardShare;
        bonusPoolNormal += normalShare;
        bonusPoolEasy += easyShare;
        
        if (ownerShare > 0) {
            (bool success, ) = payable(owner).call{value: ownerShare}("");
            require(success, "Fee transfer failed");
        }
        emit BonusPoolsFunded(amount, hardShare, normalShare, easyShare);
    }
    
    function play(uint256 _startBlock, uint256 _windowSize) public payable {
        uint256 currentFee = getCurrentEntryFee(_startBlock);
        require(msg.value == currentFee, "Incorrect amount sent");
        require(_windowSize == 1 || _windowSize == 5 || _windowSize == 10, "Invalid difficulty");
        
        totalWagered[msg.sender] += currentFee;

        if (totalWagered[msg.sender] > biggestTotalWagered) {
            biggestTotalWagered = totalWagered[msg.sender];
            biggestBettor = msg.sender;
        }

        uint256 endBlock = _startBlock + _windowSize;
        require(block.number < endBlock, "The shooting window has already passed");

        if (block.number >= _startBlock && block.number < endBlock) {
            // SUCCESS
            uint256 existingPrizePool = prizePools[_startBlock];
            uint256 gainFromPool = existingPrizePool / _windowSize;
            uint256 remainder = existingPrizePool - gainFromPool;
            
            prizePools[_startBlock] = remainder;
            attemptCounters[_startBlock] = 0;

            uint256 totalPayout = msg.value + gainFromPool;

            if (_windowSize == 1) { totalPayout += bonusPoolHard; bonusPoolHard = 0; }
            else if (_windowSize == 5) { totalPayout += bonusPoolNormal; bonusPoolNormal = 0; }
            else if (_windowSize == 10) { totalPayout += bonusPoolEasy; bonusPoolEasy = 0; }
            
            if (totalPayout > biggestPrize) {
                biggestPrize = totalPayout;
                biggestWinner = msg.sender;
            }

            totalWon[msg.sender] += totalPayout;

            (bool success, ) = payable(msg.sender).call{value: totalPayout}("");
            require(success, "Prize transfer failed");
            emit SnipeSuccess(msg.sender, block.number, totalPayout);
        } else {
            // MISS
            prizePools[_startBlock] += msg.value;
            attemptCounters[_startBlock]++;
            emit SnipeMiss(msg.sender, _startBlock, msg.value);
        }
        
        emit PlayerStatsUpdated(msg.sender, totalWagered[msg.sender], totalWon[msg.sender]);
    }
}

